import React from 'react'
import './Profile.css'
import Perfil from '../../img/perfil.jpg';

function Profile() {
  return (
    <div class="card">
        <div class="card-img"></div>
        <div class="card-info">
        <p class="text-title">Gonzalo Carlos Barroso</p>
            <p class="text-body">Electricista Gasista Plomero</p>
        </div>
    </div>
  )
}

export default Profile
